import React from 'react';
import styled from "styled-components";
import PropTypes from 'prop-types';
import { Card, Button } from "./index";
import addSvg from './add.svg';

const PanelContent = styled.div`
  background: #DFE3E6;
  border-radius: 3px;
  width: 272px;
`

const PanelItems = styled.div`
  padding: 12px 12px 0 12px;
`

const PanelBottom = styled.div`
`

const PanelButton = styled.div`
  padding: 12px;
  display: flex;
  align-items: center;
`

const Panel = ({ items }) => {
    return (
        <PanelContent>
            <PanelItems>
                {items.map(card => (
                    <Card {...card} />
                ))}
            </PanelItems>
            <PanelBottom>
                <PanelButton>
                    <img src={'./img/add.svg'} alt={'Add icon'} />
                    <span>Добавить еще одну карточку</span>
                </PanelButton>
            </PanelBottom>
        </PanelContent>
    );
};

export default Panel;
